import {ReactComponent as BaseLogoWhite} from "./logo-white.svg";
import {Link} from "react-router-dom";

/**
 * Logo react component
 */
export function Logo({color = 'black'}) {
    if (color === 'white') return <Link to="/"><BaseLogoWhite /></Link>
    return <BaseLogo />
}
